import React from "react";

class MovieList extends React.Component{
    render(){
        return(
            <>
            <div className="row">
                <div className="col lg-4">
                    <div className="card mb-4 shadow-sm">
               
                        <img src=" https://22dakika.org/wp-content/uploads/2015/09/flash-seriesbout.jpg" className="card-img-top" alt="Resim1" ></img>
                        <div className="card-body">
                            <h5 className="card-title">Örnek Film</h5>
                            <p className="card-text">Film Açıklaması</p>
                            <div className="d-flex justify-content-between align-items-center">
                                <button type="button" className="btn btn-md btn-outline-danger">Tıkla</button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            </>   
        )
    }
        
    
}

export default MovieList;
